import React from "react"

const Submit=(props)=>{
    return(
        <div>
      <div >
        <span>
          <input
            accept=".doc, .docx, .txt, .pdf"
            id="contained-button-file"
            type="file"
            onChange={props.onChange}
          />
        </span>
      </div>
    </div>
    )
}

export default Submit;
